chnology Polymer battery core for capacities up to 20,000mAh through 4W - 200mA solar panels.</p>\r\n\r\n<p>With charging efficiency of about 80%, continuous charging is not afraid of running out of power. The 20000 mAh solar power bank can be recharged easily by exposure to the sun.</p>\r\n\r\n<p>In addition, the Solar 20,000mah backup battery can also be charged by a conventional method that is charging with a current of 220V or connected to a computer via a USB port.</p>\r\n\r\n<p>20000 mAh solar power bank with 4 above charging ways, the battery will have different full charge times: 3 hours for direct charging via socket, 6 hours for charging via USB port linked to the computer Solar charger and fluorescent lamp will have full time depending on the intensity of light that the light brings.</p>\r\n\r\n<p>20000 mAh solar power bank capable of stable current transmission.</p>\r\n\r\n<p>#Pinsacduphong #sacduphong #sacmattroi,</p>\r\n\r\n\r\n\r\n', 'battery_sun_1.jpg', 229000, 20, 20, '2020-10-27', 0, 0, 1, 5, NULL, 1, 0),
