(28, 'Bluetooth Karaoke Speaker Kimiso S2 With 1 Mic Wire 3m - Upgraded Version Mn03 MP03 P88 P89 JHW 802', '<p>Bluetooth Karaoke Speaker Kimiso S2 (Black) With 1 Wired Singing Mic Direct Plug, Wireless Super Bass, Vivid Led Lights ABOUT KIMISO S2 SPEAKERS WITH MIC When you want to enjoy music outdoors but worrying about carrying large bulky speakers, now we want to introduce to you a very convenient and modern product</p>\r\n\r\n<p>- KIMISO S2 Portable Bluetooth Karaoke Speaker with wireless mic is very convenient when traveling Outdoors, with high quality sound, good speaker effects, great bass, you can freely listen to your favorite music wherever you want.</p>\r\n\r\n<p>HIGHLIGHTS</p>\r\n\r\n<p>Especially With Super Bass Loudspeaker, For Super Bass, Sound Extremely Solid And No Disturbing.</p>\r\n\r\n<p>- With HANDLING CALLING FUNCTION When Connecting Speaker to Phone via Bluetooth.</p>\r\n\r\n<p>- Full Ports: Bluetooth, USB, TF Card, AUX Audio Jack, MIC Jack</p>\r\n\r\n<p>- Plug in Mic and sing Karaoke easily, have a customized way for Mic on the speaker - Support Audio Input of GHITA POWER.</p>\r\n\r\n<p>- Connects to All Devices: Phone, Ipad, Player, Laptop, PSP, ... Through Connection Ports.</p>\r\n\r\n<p>- Design Diverse Function Keys, Easily Customize Sound To Suit Your Hearing preferences.</p>\r\n\r\n<p>- With Handles In Many Plots, Easily Take With You When Going Anywhere</p>\r\n\r\n<p>PRODUCT INFORMATION</p>\r\n\r\n<p>- Material: High-grade ABS plastic</p>\r\n\r\n<p>- Bluetooth connection distance: 10m</p>\r\n\r\n<p>- Support ports: USB, Memory card, Aux, Mic</p>\r\n\r\n<p>- Power: 2x20W</p>\r\n\r\n<p>- PIN capacity: 10000mAh (Continuous use in 6 - 8 hours continuous) Can be used as a power bank.</p>\r\n\r\n<p>- Power supply: Use the 5V-1A / 2A Adapter to charge the device, and the Adapter over 5.5V may cause damage to the device.</p>\r\n\r\n<p>- Weight: 2 KG</p>\r\n\r\n<p>- Size: 18 (high) x 38 (horizontal) x 16 (thick)</p>\r\n\r\n<p>- FullBox: Speaker