(29, 'Mini Bluetooth Speaker Color Change LED Light', '<p>Lớp vỏ ngo&agrave;i của Loa Bluetooth bằng nhựa chống trơn trượt<br />\r\nThiết kế tinh tế, c&ocirc;ng nghệ đột ph&aacute;, sử dụng đơn giản, kiểu đ&oacute;ng g&oacute;i độc đ&aacute;o.<br />\r\nPh&aacute;t nhạc qua bluetooth của c&aacute;c thiết bị c&oacute; chức năng ph&aacute;t nhạc qua bluetooth.<br />\r\nChiếc loa bluetooth c&oacute; &acirc;m thanh bass kh&aacute; tốt, chuy&ecirc;n bass trầm mạnh.<br />\r\nH&igrave;nh ảnh sản phẩm khi l&ecirc;n h&igrave;nh c&oacute; thể c&oacute; sự kh&aacute;c biệt m&agrave;u sắc do hiệu ứng khi chụp ảnh, g&oacute;c nh&igrave;n.</p>\r\n\r\n<p>* Bảo h&agrave;nh: 01 th&aacute;ng<br />\r\n* Th&ocirc;ng tin chi tiết sản phẩm:</p>\r\n\r\n<p>- &nbsp;Loa Output: 3w<br />\r\n- Tần số đ&aacute;p ứng: 60HZ - 20KHz<br />\r\n- Signal-to-noise: &ge; 90dB<br />\r\n- Distortion: &le; 0,5% @ (1KHz)<br />\r\n- Pin điện &aacute;p / c&ocirc;ng suất: 350mAh<br />\r\n- Pin sạc điện &aacute;p: 5V &plusmn; 0.5V<br />\r\n- Thời gian sạc pin: 2 giờ<br />\r\n- Bluetooth phi&ecirc;n bản: V2.1 (tần số 2402-2480MHz)<br />\r\n- Phạm vi l&agrave;m việc l&ecirc;n tới: 10m<br />\r\n- Thời gian l&agrave;m việc l&ecirc;n tới: 1 - 3 giờ<br />\r\n- K&iacute;ch thước: 60mm x 50mm</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp;<br />\r\n&nbsp;<br />\r\n#loa #linhkien #phukien #bluetooh #a9</p>', 'mini_speaker_1.jpg', 70000, 10, 10, '2020-12-15', 0, 0, 2, 10, NULL, 1, 0),
